    true,nt"url": null,nt"notes": "General Purpose Data and Statistics.  GradeDEC.Net
    is a web-based tool for the investment analysis of highway-rail grade crossing improvements.
     It provides state departments of transportation, local governments, metropolitan
    planning agencies, inspectors, and railroad companies with the online ability to
    conduct benefit-cost analysis of highway-rail grade crossing infrastructure investments.
    GradeDEC.Net allows users to divert highway traffic to and from closed or separated
    grade crossings to adjacent crossings, and calculate a full set of benefits including
    changes in accident risk associated with changes in traditional grade crossing technology.
    Users can also evaluate supplemental safety measures listed in the Notice of Proposed
    Rulemaking covering the use of locomotive horns at highway-rail grade crossing.
    Users are also able to save an analysis on-site for later revision and update and
    submit reports directly to the FRA.  ",nt"owner_org": "fc5cb2c1-d0b0-482a-8a52-7d42ea186ae1",nt"extras":
